Release Info:

Los Santos: a sprawling sun-soaked metropolis full of self-help gurus,
starlets and fading celebrities, once the envy of the Western world, now
struggling to stay afloat in an era of economic uncertainty and cheap
reality TV.
Amidst the turmoil, three very different criminals plot their own chances
of survival and success: Franklin, a street hustler looking for real
opportunities and serious money; Michael, a professional ex-con whose
retirement is a lot less rosy than he hoped it would be; and Trevor, a
violent maniac driven by the chance of a cheap high and the next big score.
Running out of options, the crew risks everything in a series of daring and
dangerous heists that could set them up for life.


